    return(
        <Container>
            <Row>
                <Col sm = {12} md= {6}>Hello World</Col>
                <Col sm = {12} md= {6}>Hello World</Col>
                <Col sm = {12} md= {6}>Hello World</Col>
                <Col sm = {12} md= {6}>Hello World</Col>
            </Row>
        </Container>
    )
}

export default Helper
